import React, { memo } from "react";

import { RankingWrapper, RankingLeft, RankingRight } from "./style";

export default memo(function LJRanking() {
  return (
    <RankingWrapper>
      <RankingLeft>
        <h2>123123</h2>
        <h2>123123</h2>
        <h2>123123</h2>
        <h2>123123</h2>
      </RankingLeft>
      <RankingRight>
        <div className="rankingTitle"></div>
        <div className="rankingList">
          <h2>13412</h2>
          <h2>134124</h2>
          <h2>1421</h2>
          <h2>142134</h2>
        </div>
      </RankingRight>
    </RankingWrapper>
  );
});
